import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  height: 80px;

  position: absolute;
  top: 0;
  width: 100%;
  display: flex;
  align-items: center;

  h1 {
    font-weight: 300;
    font-size: 2rem;
  }
`;

export const Github = styled.div`
    display: flex;
    align-items: center;
`;
